import React from "react";

const List = ({ paroisses }) => {
  return(
    <div className="list-paroisses-container">
      {
        paroisses.map((paroisse) => {
          return(
            <div className="list-par">
              <p>{paroisse.name}</p>
            </div>
          )
        })
      }
    </div>
  )
};

export default List;
